High Life (2009)  

Verenigde Staten / Canada
Komedie / Misdaad
80 minuten

geregisseerd door Gary Yates
met Timothy Olyphant, Stephen Eric McIntyre en Rossif Sutherland

Het jaar 1983. De junkie Dick krijgt bezoek van iemand die hij kent uit het verre verleden: zijn ex-celmaatje Bug. Bug is handig met pinautomaten en daardoor komt Dick op het idee om drie pinautomaten leeg te halen.

